import React from 'react';

const About = () => {
  return (
    <div className="page-content">
      <h1>About Me</h1>
      <p>I'm a passionate developer with experience in building interactive web applications.</p>
      <p>My journey in web development started with HTML, CSS, and JavaScript, and has evolved to include modern frameworks like React and Three.js.</p>
      <p>I enjoy creating immersive experiences that combine aesthetics with functionality.</p>
      <div className="about-details">
        <h2>Background</h2>
        <p>With a background in [Your Background], I bring a unique perspective to my development work.</p>
        <h2>Philosophy</h2>
        <p>I believe in creating web experiences that are not only visually appealing but also intuitive and accessible.</p>
      </div>
    </div>
  );
};

export default About;
